import '../style/Header.css'

import aboutPhoto1 from '../assets/photo1.JPG'

function About() {
    return(
        <div>
            <h1>About Us</h1>
            <section style={{display: 'flex', justifyContent: 'space-around', padding: '30px'}}>
            <img src={aboutPhoto1} alt='Photo of Employees' style={{width: '20%', borderRadius: '10px'}}/>
            <p>Mora Desings is a family owned company. Emily and Kyler Mora decided to put their skills and passions together to help other improve thier company and brand. </p>
            </section>
        </div>
    )
}

export default About;
